import PropTypes from 'prop-types'

const Link = ({ active, children, onClick }) => (

  <a href="#" onClick={(e) => {
    e.preventDefault()
    onClick()
  }}>
    {children}
  </a>
)

Link.propTypes = {
  children: PropTypes.node.isRequired,
  onClick: PropTypes.func.isRequired
}

export default Link
